Returns the last status change time of the file, in nanoseconds since [`st_ctime`].

[`st_ctime`]: Self::st_ctime

# Examples

```no_run
use std::fs;
use std::io;
use std::os::linux::fs::MetadataExt;

fn main() -> io::Result<()> {
    let meta = fs::metadata("some_file")?;
    println!("{}", meta.st_ctime_nsec());
    Ok(())
}
```
